import React, { useState, useEffect } from "react";
import { useLocation, useParams,useNavigate, Navigate, createSearchParams } from "react-router-dom";
import axios from "axios";

import Header from "../layouts/Header";
import Card from "../layouts/Card";


export default function PatientProfile(props)
{
    const location = useLocation();
    const ssn = new URLSearchParams(location.search).get('ssn');
    
    const [patient, setPatient] = useState({});


    
    

    useEffect(() => {
        axios.get(`http://localhost:8080/patients/getPatient/${ssn}`)
          .then(response => {
            setPatient(response.data);
          })
          .catch(error => {
            console.error('Error fetching patient data:', error);
          });
      }, [ssn]);

      const details ={type:"patient", firstRow:patient.name, secondRow:patient.surname, thirdRow: patient.birthdate, forthRow: patient.gender};
    return <div>
        <Header title= {"ToothHub"}/>

        <main>
        <Card details={details}/>
        </main>

    </div>;




}
